svg.script:
document.addEventListener("DOMContentLoaded", function () {
  var regions = document.querySelectorAll(".india-state");
  regions.forEach(function (region) {
    region.style.cursor = "pointer";
    region.addEventListener("click", function () {
      var stateName = region.getAttribute("data-state");
      if (!stateName) return;
      var urlState = encodeURIComponent(stateName);
      // navigate from the parent page, not inside the <object>
      window.top.location.href = "../../products.html?state=" + urlState;
    });
  });
});
